import {CardWrapper, CardHeader, qrCode} from "./Components/qrcard.style";
import imageqr from "../images/image-qr-code.png";

function App() {
  return (
    <div className="App">
        <CardWrapper>
          <CardHeader>
            <qrCode src={imageqr}></qrCode>
          </CardHeader>
        </CardWrapper>
    </div>
  );
}

export default App;
